    true,nt"url": null,nt"notes": "School Districts are single-purpose administrative
    units within which local officials provide public educational services for then
                  area's residents.  The Census Bureau obtains the boundaries, names,
    local education agency codes, grade ranges, and school district levels for schooln
                  districts from State officials for the primary purpose of providing
    the U.S. Department of Education with estimates of the number of children in povertyn
                  within each school district.  This information serves as the basis
    for the Department of Education to determine the annual allocation of Title I fundingn
                  to States and school districts. n               n               The
    TIGER/Line shapefiles and related database files (.dbf) are an extract of selected
    geographic and cartographic information from the U.S. Censusn               Bureau's
    Master Address File / Topologically Integrated Geographic Encoding and Referencing
    (MAF/TIGER) Database (MTDB).  The MTDB represents a seamlessn               national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed to stand alone as an independent data set, or theyn               can
    be combined to cover the entire nation.nn               TIGER/Line Shapefiles include
    separate shapefiles for elementary, secondary and unified school districts. The
    school district boundaries are those inn               effect for the 2013-2014
    school year.n            ",nt"license_title": "Creative Commons Attribution",nt"extras":
